import React from "react";
import "./App.css";
import SubscriptionPlans from "./SubscriptionPlans";

function App() {
  return (
    <div className="app-container">
      <h1 className="app-header">Escolha o seu plano</h1>
      <SubscriptionPlans />
    </div>
  );
}

export default App;
